(1, 1, 'ZONA DEPORTIVA | Artículos Deportivos', 'https://www.visualchile.cl/', 'Artículos Deportivos, accesorios, tienda online, venta productos, Implementación Deportiva', 'Zona Deportiva, Tienda online de Artículos Deportivos. Atención especial a colegios, empresas e instituciones. ', 'Zona Deportiva, Deportes, Accesorios, Implementos, Balones medicinales, Balones de ejercicios, Bombines, Colchonetas nacionales, Colchoneta, Colchoneta de ejercicios, Colchonetones, Cuerdas, escalerillas. conos, Mesas de Pool, Taca taca, Caballetes, Cajon de Salto, Trampolín, Arcos de Baby, Elásticos, barras de Equilibrio, Mancuernas, pesas tobillo, Pelotitas relajación, Roller, Tatamis, Trampolines, Correas tipo TRX, patin, patines, Yoga, Artes marciales, Básquetbol, Balones, babyfútbol, Balones fútbol, Balones voleibol, Gimnasia, Natación, Ropa fútbol, Bicicleta de Spinning, Trotadora, Rodillo para Bicicleta,  Elìptica, Mancuernas, mancuerna, Pesas, Pesa Rusa, Kettlebell, Barra z, Maquina de Ejercicos, Home Gym, ', 'Spanish', '1 days', 'index,follow', 'archive', 'Global', 'RX4a4w3HH_bKhNyUUlXsjzBwcIqO73ErPJYk6ghOfVs', 1, '2013-01-13 23:48:37', '2020-08-14 11:24:36', 'admin');
INSERT INTO paginas (id, titulo, descripcion, introduccion, imagen, mtitulo, mdescripcion, mclaves, mautor, mrobots, fingreso, factualizacion, creador) VALUES
(1, 'empresa.php', '<img style=\"width:800px;height:200px\" src=\"/admvisch/public/php../../../../dinamicos/imagenes_zd/Banner_ZonaDeportiva01.jpg\"><br><br>Conscientes\r\nde la importancia que significan las actividades deportivas para una vida\r\nsaludable y de calidad. Hemos creado una alternativa eficiente y responsable\r\ncon clientes que necesitan artículos de esta área. <br><p>Zona deportiva es una empresa joven que entra al mercado de las ventas\r\nonline de implementación deportiva y aspira satisfacer la necesidad de clientes\r\nque buscan un proveedor de confianza y que les entregue seguridad para comprar\r\nproductos de calidad. Además de nuestra venta al detalle contamos con\r\nimportantes beneficios a instituciones, colegios, empresas privadas,universidades y el sistema de Mercado Público. Envíenos\r\nun correo y un ejecutivo lo contactará a la brevedad. </p>\r\n    <ul><ul type=\"disc\"><li>Tenemos productos de gran calidad.\r\n     </li><li>Somos una empresa sería y\r\n     responsable.</li><li>Estamos en constante\r\n     comunicación con nuestros clientes.</li><li>Importantes beneficios a instituciones.</li></ul></ul>   <br>\r\n    <h1>Zona Deportiva SpA</h1><ul><li>Es un empresa de Sociedad por Acciones.</li><li>R.U.T: 76.432.927-9</li><li>Dirección: Millaray Norte 258 comuna de Maipú.</li><li>Teléfonos: +562-2884 0638</li><li>Móvil: +56 9 7958 4383</li><li>Correo: contacto@zonadeportiva.cl<br></li></ul><hr>', '', NULL, 'Empresa', 'Zona deportiva es una empresa joven que entra al mercado de las ventas online de implementación deportiva y aspira satisfacer la necesidad de clientes que buscan un proveedor de confianza y que les entregue seguridad para comprar productos de calidad. Además de nuestra venta al detalle contamos con importantes beneficios a instituciones, colegios, empresas privadas,universidades y el sistema de Mercado Público. Envíenos un correo y un ejecutivo lo contactará a la brevedad. ', 'Zona deportiva, tienda online, implementación deportiva, artículos deportivos, Colchonetas, Patín, Patín artístico, Fitness, Crossfit, Aerobox, Deportes, Colchonetas de ejercicios, Atletismo', '', 'index,follow', '2014-05-20 09:00:14', '2016-05-10 22:41:55', 'mbravo'),
(2, 'como-comprar.php', '<p><img style=\"width:800px;height:200px\" src=\"/admvisch/public/php../../../../dinamicos/imagenes_zd/Banner_ZonaDeportiva02.jpg\"><br></p><p><br></p><p>Para realizar una compra usted debe crear una cuenta de usuario, donde obtendremos sus datos para realizar el envío e información para contactarle de ser necesario.</p><p>Usted puede comprar directamente a través del carro de compras y hacer el pago con Redcompra o Tarjetas Bancarias mediante el sistema Webpay Plus de Transbank que garantiza la seguridad en su transacción.</p><p>Todos los precios publicados en nuestro sitio ya se encuentran con el I.V.A incluido.<br></p><p>No tenemos un mínimo de compra, pero debe tener en cuenta que en ocasiones el valor del envío podría ser superior al costo del producto si este fuera bajo.</p><p>Debe considerar que algunos artículos o productos podrían diferir en color, tono, disposición de color, estética o forma con respecto a la fotografía exhibida. esto debido a la instancia de producción de nuestros proveedores. Sin embargo tratamos de mantener en constante actualización nuestras imágenes. <br></p><p>Por el momento no realizamos ventas en nuestra dirección física. Somos una empresa de venta online.</p>', '', NULL, 'Comprar en Zona Deportiva', 'Información para quienes deseen comprar en Zona Deportiva', 'Artículos Deportivos, Implementación Deportiva, Zona Deportiva, Deportes, Colchonetas, Fitness, Crossfit, Aerobox, ', '', 'index,follow', '2014-12-16 00:00:00', '2015-10-03 11:20:23', 'mbravo'),
(3, 'despacho.php', '<p><img style=\"width:800px;height:200px\" src=\"/admvisch/public/php../../../../dinamicos/imagenes_zd/Banner_ZonaDeportiva03.jpg\"><br></p><p><br></p>\r\n<p>Todos los despachos tienen como base la entrega dentro de 2 días hábiles siguientes a la transacción o compra. El término o modo de envío: <strong>DÍA HÁBIL SIGUIENTE</strong>, al que hace mención y referencia nuestro formulario de despacho y carro, es un <strong>concepto utilizado entre Chilexpress y Zona Deportiva SpA y no obedece necesariamente a que una compra realizada en nuestro sitio llegue 24 horas después a su destino.</strong></p><p>  Los envíos están divididos en dos áreas: <strong style=\"\" mso-bidi-font-weight:normal\"\"=\"\">Santiago </strong>y<strong> Regiones</strong></p>\r\n<p><strong>Para Santiago</strong>: Nuestro sistema de carro de compra le dará\r\nen forma automática&nbsp; el monto a cancelar por concepto de despacho. &nbsp;Nuestros\r\nproductos son enviados a través de Chilexpress con un tiempo de llegada a\r\ndestino de 2 a 3 días hábiles. Para artículos de gran volumen o compras realizadas\r\npor colegios o intituciones, coordinamos con el cliente para realizar\r\ndespacho. Este tipo de despacho tiene un tiempo de entrega de hasta 5 días hábiles.</p>\r\n<p><strong>Para Regiones: </strong>Enviamos todos los pedidos a regiones bajo\r\nla modalidad \"por pagar\". Los envíos se realizan a través de Chilexpress\r\no la empresa de preferencia de nuestro cliente. Este despacho es coordinado en\r\nforma interna. Podemos entregar&nbsp;un valor aproximado del costo&nbsp;del\r\nflete.&nbsp;Como así también recomendar la mejor alternativa según el punto de\r\ndestino.</p>\r\n<p>Todo despacho es realizado por empresas externas a Zona Deportiva, por lo\r\nque en caso de inconvenientes durante el envío rogamos la compresión del caso\r\nen particular y nos comprometeremos a brindar una solución en conjunto a su\r\nsolicitud lo antes posible. Sin embargo las distintas empresas de transporte poseen\r\ndistintos ritmos y tiempos de trabajo que se deben tener en consideración y en\r\nningún caso serán responsabilidad de Zona Deportiva atrasos o demoras en la entrega.</p>\r\n<h1><br> Políticas de despacho de Chilexpress (empresa externa)  </h1>\r\n<br><br>  \r\n1.\r\n¿Cuál es el plazo para retirar un envío en una sucursal de Chilexpress?  \r\n<p>El destinatario tiene un plazo de 5 días hábiles para retirar el envío. Una\r\nvez finalizado ese plazo, el envío será devuelto al remitente.</p>\r\n<p>2. ¿Qué ocurre si nadie puede recibir el envío en la dirección de destino?</p>\r\n<p>Chilexpress dejará un aviso de visita en la dirección de envío y realizará\r\nun segundo intento de entrega al día hábil siguiente. Si, nuevamente, no se\r\npuede efectuar la entrega, el envío será devuelto al remitente.</p>\r\n<p>3. ¿Cuántos intentos de entrega en el domicilio realiza Chilexpress, antes\r\nde devolver un envío al remitente?</p>\r\n  Chilexpress realiza dos intentos de entrega en el domicilio, en dos días\r\nhábiles y horarios distintos, los que son notificados al destinatario. Si no se\r\npuede efectuar la entrega, el envío será devuelto al remitente.\r\n<p>Sí el envío es devuelto al remitente por razones ajenas al servicio tales como:</p>\r\n<ul><li><strong>No se encuentran personas en el destino.</strong></li><li><strong>Error de dirección.</strong></li><li><strong>Rechazo de mercadería.</strong></li><li><strong>Domicilio cerrado.</strong></li><li><strong>Cliente no retira material en el plazo estipulado en oficina.</strong></li></ul>\r\n<p>El cliente puede retirar el material en nuestra dirección, pero si solicita\r\nun nuevo despacho, este tendrá que cancelar nuevamente el gasto de envío.</p><p>Para mayor información sobre Chilexpress dirijase a su sección de<a target=\"_blank\" href=\"https://www.chilexpress.cl/Views/ServicioAlCliente/FAQ.aspx?cod=2#collapse9\"> Preguntas frecuentes.</a>  <br></p>\r\n<p>Para políticas de despacho de otras empresas de transportes será\r\nresponsabilidad del cliente obtener esta información.<br></p>', '', NULL, 'Despacho', 'Hacemos despachos a todo Chile. Más Información aquí.', 'Despacho, Artículos Deportivos, Articulos deportivos, Implementación Deportiva, Implementos deportivos, Colchonetas, Fitness, Crossfit, Aerobox, Patines, Patinaje artístico, Patinaje artistico, Zonadeportiva, Zona Deportiva', '', 'index,follow', '2014-12-16 00:00:00', '2016-05-10 23:57:48', 'mbravo'),
(4, 'instituciones.php', '<br><p>Sabemos que hoy el tiempo es algo muy valioso y entendemos que para los\r\nencargados de compra de colegios e instituciones siempre existen un montón de\r\ntareas que realizar. Por eso es que queremos facilitar sus funciones proveyendo\r\nde los presupuestos necesarios, cotizaciones de productos requeridos y visitas\r\na sus propias oficinas o colegios con motivo de que conozcan nuestros artículos\r\ny su calidad. </p>\r\n<p>Envíenos un correo a <a href=\"mailto:contacto@zonadeportiva.cl\">contacto@zonadeportiva.cl</a>\r\nsolicitando una visita o presupuesto de los productos que necesiten. Estaremos\r\nencantados de poder ayudarles.</p>\r\n<p>También puede llamarnos al 02 2884 0638 para agendar una reunión o hacernos\r\nalguna consulta.</p>\r\n    <br>\r\n    <h1>Importantes Beneficios</h1><br><br>  \r\n<p>Nos interesa crear redes de clientes satisfechos con nuestro servicio, por\r\nlo que hemos dispuesto importantes beneficios para los colegios o instituciones,\r\nque confíen en nosotros. Dependiendo del monto de la compra, coordinamos\r\ndespachos sin costos y realizamos porcentajes&nbsp;\r\nde descuentos. Esto siempre con la mejor calidad en todos nuestros\r\nproductos.</p>', '', NULL, 'Instituciones', 'Optimice sus tiempos y conozca beneficios.', 'Instituciones, Zonadeportiva, Implementos Deportivos,', '', 'index,follow', '2015-06-03 00:00:00', '2015-10-03 11:34:08', 'mbravo'),
(6, 'ubicacion.php', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3326.7605799096923!2d-70.76133958420077!3d-33.50760570783534!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x9662dcd4a2982133%3A0x54767487228deeae!2zR3JhbCBPcmTDs8OxZXogMTU1LCBNYWlww7osIFJlZ2nDs24gTWV0cm9wb2xpdGFuYQ!5e0!3m2!1ses!2scl!4v1605793233849!5m2!1ses!2scl\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" tabindex=\"0\"></iframe>', '', '', '', '', '', '', 'index,follow', '2015-06-18 17:32:10', '2020-11-19 11:28:17', 'mbravo'),
(7, 'terminos-y-condiciones.php', '<p>Las transacciones que se efectúen a\r\ntravés del sitio www.zonadeportiva.cl se sujetan a los presentes términos y\r\ncondiciones.</p><p>Es requisito para comprar en&nbsp; Zona Deportiva SpA la aceptación de los\r\ntérminos y condiciones de ventas descritos a continuación. Cualquier persona\r\nque realice una transacción en el sitio www.zonadeportiva.cl, se entiende que\r\nconoce y acepta todas y cada una de las condiciones descritas en estos términos\r\ny condiciones.</p><h2>Registro del Usuario o Cliente\r\n</h2><p>El registro del cliente en este sitio\r\nconstituye una condición indispensable para comprar productos a través del mismo.\r\nPara ello, el cliente debe registrar en la página de registro sus datos básicos\r\ncomo el número de cédula de identidad, dirección y teléfonos, los cuales se\r\nconsiderarán como fidedignos. El registro del cliente en el sitio www.zonadeportiva.cl\r\nimplica el conocimiento y aceptación de los términos y condiciones de ventas\r\ndescritos en el presente documento.</p>\r\n<p>El usuario inscrito podrá a través de www.zonadeportiva.cl\r\ndisponer la rectificación, eliminación y/o cancelación de sus datos cuando lo\r\nestime conveniente, en conformidad a la ley 19.628.</p>\r\n<h2>Comunicaciones Promocionales o\r\nPublicitarias</h2>\r\n<p>Una vez realizada la transacción, el\r\nusuario podrá solicitar la suspensión de toda comunicación promocional o\r\npublicitaria enviada a su correo electrónico haciendo click en el link\r\ndispuesto para ello.</p>\r\n<h2>Clave Secreta</h2>\r\n<p>Una vez registrado, el cliente deberá\r\ningresar su clave secreta para realizar cada compra, lo que permitirá el acceso\r\npersonalizado, confidencial y seguro. La administración de esta clave secreta\r\nes de absoluta responsabilidad del cliente. Su entrega a terceras personas o su\r\nutilización por dichas terceras personas, no implicará responsabilidad alguna\r\npara Zona Deportiva SpA. El usuario tendrá la posibilidad de cambiar la clave\r\nde acceso, para lo cual deberá sujetarse al procedimiento establecido en el\r\nsitio respectivo.</p>\r\n<h2>Procedimiento Para Hacer Uso de este\r\nSitio Internet</h2>\r\n<p>Por medio de este sitio, se informa, de\r\nmanera inequívoca y fácilmente accesible al cliente, los pasos que deben\r\nseguirse para comprar productos a través de esta página web. El solo hecho de\r\nseguir los pasos que para tales efectos se indican en este sitio para efectuar\r\nuna compra, equivale a aceptar que efectivamente&nbsp; Zona Deportiva SpA ha dado cumplimiento a las\r\ncondiciones contenidas en este punto.</p>\r\n<p>Se indicará, además, la dirección de\r\ncorreo postal o electrónico de&nbsp; Zona\r\nDeportiva SpA y los medios técnicos a disposición del consumidor para\r\nidentificar y corregir errores en el envío o en sus datos.</p>\r\n<h2>Medios de Pago y Otros</h2>\r\n<p>Se podrán utilizar los medios de pago informados\r\nen la propia página web.</p>\r\n<p>En caso de utilizarse las tarjetas\r\nbancarias aceptadas en este sitio, están sujetos al contrato existente entre el\r\ncliente y el Banco emisor, sin que a&nbsp; Zona\r\nDeportiva SpA le quepa responsabilidad alguna en relación con los aspectos\r\nseñalados en dichos contratos.</p>\r\n<h2>Cupones y Descuentos Especiales</h2>\r\n<p>Se podrán utilizar cupones otorgados\r\ntanto por&nbsp; Zona Deportiva SpA como por\r\nexternos.</p>\r\n<p>• En caso de utilizarse los cupones como\r\nmedio de pago estos podrán ser utilizados sólo una vez y por el valor al cual\r\ncorresponde el monto del cupón a utilizar.</p>\r\n<p>• Los descuentos proporcionados por medio\r\nde cupones no son acumulables entre sí, ni tampoco con otras promociones.</p>\r\n<p>•\r\nAlgunos cupones pueden tener limitaciones como: cantidad de uso, consumo mínimo\r\no fecha de expiración. </p>\r\n<p>Si deseas obtener más información sobre\r\nlas condiciones/limitaciones de tu cupón de descuento, puedes contactarnos a\r\nnuestro servicio al cliente llamando al 22884 0638 o desde celulares al 02 2884\r\n0638.</p>\r\n<h2>Información del Consentimiento</h2>\r\n<p>Toda aceptación de oferta quedará sujeta\r\na la condición suspensiva de que&nbsp; Zona\r\nDeportiva SpA valide la transacción. En consecuencia, para toda operación que\r\nse efectúe en este sitio, la confirmación y/o validación o verificación por\r\nparte de&nbsp; Zona Deportiva SpA, será\r\nrequisito para la formación del consentimiento. Para validar la\r\ntransacción&nbsp; Zona Deportiva SpA deberá\r\nverificar:</p>\r\n<p>a) Que dispone, en el momento de la\r\naceptación de oferta, de los productos en stock.</p>\r\n<p>b) Que valida y acepta el medio de pago ofrecido\r\npor el usuario.</p>\r\n<p>c) Que los datos registrados por el\r\ncliente en el sitio coinciden con los proporcionados al efectuar su aceptación\r\nde oferta.</p>\r\n<p>Para informar al usuario o consumidor\r\nacerca de esta validación,&nbsp; Zona\r\nDeportiva SpA deberá enviar una confirmación escrita a la misma dirección\r\nelectrónica que haya registrado el usuario aceptando de la oferta, o por\r\ncualquier medio de comunicación que garantice el debido y oportuno conocimiento\r\ndel consumidor, el que se le indicará previamente en el mismo sitio.</p>\r\n<p>Asimismo, en el mismo sitio se informará,\r\ncuando corresponda, si el documento electrónico en que se formalice el contrato\r\nserá archivado y si éste será accesible al consumidor.</p>\r\n<p>El consentimiento se entenderá formado\r\ndesde el momento en que se envía esta confirmación escrita al usuario y en el\r\nlugar en que fue expedida, esto es la ciudad de Santiago y comuna de Maipú.</p>\r\n<h2>Despacho de Productos </h2>\r\n<p>Los productos objeto de la transacción,\r\nserán enviados al cliente al domicilio que este haya señalado al registrarse en\r\nel sitio web, en los plazos indicados que deben ser coordinados por ambas\r\npartes.</p>\r\n<p><strong>El valor de envío de los productos será\r\nde responsabilidad del cliente cancelarlo.</strong> (Para mayores detalles vea sección “despacho”)</p>\r\n<h2>Cambio, Devolución y Reembolso de\r\nProducto </h2>\r\n<p>Los requisitos para cualquier cambio,\r\ndevolución o reembolso son los siguientes:</p>\r\n<p>• Solicitud de cambio deben ser dentro de\r\nlos 2 meses desde la recepción del producto, en caso de deficiencias de\r\nfabricación, elaboración, materiales o en caso de que no sea enteramente apto\r\npara el uso o consumo al que está destinado.</p>\r\n<p>• Las devoluciones solo se aceptan dentro\r\nde los 10 primeros días de corridos una vez realizada la compra, solo se\r\naceptan y realizan devoluciones con boleta original en la dirección Millaray\r\nNorte 258, Maipú, Santiago y tras previa comunicación y coordinación de ello.</p>\r\n<p>• Los reembolsos solo se realizan por\r\nmedio de transferencia bancaria.</p>\r\n<p>&nbsp;•\r\nEl producto debe estar sin uso, con etiquetas, en perfectas condiciones y debe\r\ntener los embalajes originales.</p>\r\n<p>• No se realizarán cambios, devoluciones\r\ny reembolso cuando las razones sean atribuibles a gustos o apreciaciones\r\npersonales del cliente.</p>\r\n<h2>Uso de los Datos Personales Registrados en el Sitio</h2>\r\n<p>Tendrán como finalidad validar las\r\nórdenes de compra y mejorar la labor de información y comercialización de los\r\nproductos y servicios prestados por las empresas, en ningún caso serán\r\ntraspasados a terceros, salvo personas o empresas relacionadas con&nbsp; Zona Deportiva SpA.</p>\r\n<h2>Información Contenida en este Sitio</h2>\r\n<p>&nbsp;Zona\r\nDeportiva SpA podrán modificar cualquier información contenida en este sitio,\r\nen cualquier momento y sin previo aviso, hasta el momento de la validación de\r\nla transacción, la cual obligará a&nbsp; Zona\r\nDeportiva SpA, sujeto a las condiciones de validación.</p>\r\n<h2>Contacto</h2><p>&nbsp;Correo Electrónico:<a href=\"mailto:contacto@zonadeportiva.cl\"> contacto@zonadeportiva.cl</a>  </p>', '', '', '', '', '', '', 'index,follow', '2015-06-18 17:32:27', '2021-04-07 12:53:25', 'mbravo');
