INSERT INTO preguntas (id, titulo, descripcion, posicion, estado, fingreso, factualizacion, creador) VALUES
(1, '¿Tienen Factura o Boleta?', '<p>Zona Deportiva vende todos sus productos con boleta o factura electrónica. Usted debe informar que opción desea y agregar&nbsp;los&nbsp;datos correspondientes&nbsp;en el caso de las factura. <br></p>', 1, 1, '2014-06-04 15:52:03', '2020-12-23 16:52:54', 'mbravo'),
(2, '¿Los productos tienen garantía?', '<p>Todos nuestros artículos deportivos o productos poseen garantía de 3 meses por fallas de material o fabricación. Debes presentar la\r\nboleta o factura al momento de solicitar la garantía. La garantía no cubre el costo del despacho. Envía un correo a contacto@zonadeportiva.cl para entregarte mayores detalles del proceso.</p><p>Esta garantía no considera la devolución del dinero.</p><p>La garantía y posterior cambio dependerá de la disponibilidad de stock nuestro o de nuestros proveedores al momento de hacer dicho trámite, así como también el  tiempo de espera\r\npuede variar dependiendo del tiempo de gestión que tiene el servicio técnico de cada\r\nmarca. Para cada caso se informará según corresponda.<br></p>', 6, 1, '2014-06-04 15:52:10', '2017-06-28 12:48:57', 'mbravo'),
(3, '¿Puedo obtener descuento?', '<p>Si necesitas una gran cantidad de artículos deportivos o eres de alguna empresa, institución o colegio y necesitas realizar una compra importante, no dudes en comunicarte con nosotros y veremos la forma de contactarte y atender tus requerimientos. Zona Deportiva otorga descuentos y brinda alternativas de despacho para estas ocasiones. No dudes en cotizar una alternativa distinta a nuestra venta al detalle.</p><p>Contactanos al correo contacto@zonadeportiva.cl o bien llamar o enviar mensaje al&nbsp;<strong>+56 9 3936 9828.</strong><br></p>', 7, 1, '2014-06-04 15:52:21', '2020-12-23 16:49:06', 'mbravo'),
(4, '¿Cuál es el horario de atención?', '<p>Zona Deportiva atiende telefónicamente sus consultas e inquietudes de Lunes a Viernes de 10:00 a 18:30 y Sábados de 10:00&nbsp;a 13:30. Otras formas de recibir ayuda es a través de nuestro correo: contacto@zonadeportiva.cl y el Whatsapp&nbsp;<strong>+56 9 3936 9828</strong>,&nbsp;nos preocuparemos de responder a la brevedad.<br></p><p><strong>En nuestra ubicación de calle GRAL. ORDÓÑEZ 155 Oficina 1002 el horario de atención es de 10.00 a&nbsp;18.30. De&nbsp;todas maneras,&nbsp;recomendamos que pueda&nbsp;coordinar con nosotros,&nbsp;antes su visita,&nbsp;para atenderle de mejor forma y con las medidas sanitarias necesarias.</strong></p>', 4, 1, '2015-07-22 18:24:19', '2020-12-23 16:56:59', 'mbravo'),
(5, '¿Cuál es medio de pago?', '<p>Puedes cancelar tus pedidos con Redcompra o tarjetas bancarias vía WEBPAY, lo que garantiza la su seguridad de su transacción. Para compras de gran volumen o grandes cantidades debe contactarse vía correo: contacto@zonadeportiva.cl y acordaremos otros medios de pago y de despacho.<br></p><p>En nuestra oficina también contamos con POS de Transbank para compras con tarjetas de débito y crédito.</p><p><strong>En este momento, debido a la actual contingencia sanitaria, NO RECIBIMOS&nbsp;PAGOS EN EFECTIVO.</strong></p>', 3, 1, '2015-07-22 18:30:43', '2020-12-23 16:51:58', 'mbravo'),
(6, '¿Hacen reembolsos o devolución de dinero?', '<p>Tienes 10 días a partir de la recepción del artículo o producto.<br><br>Para solicitar una devolución o reembolso de dinero, debes enviar un mensaje al correo: contacto@zonadeportiva.cl y debes informar el número de boleta o factura, nombre y teléfono con quién comunicarnos. Nosotros te contactaremos para mayores detalles.<br><br>Zona Deportiva <strong>NO HACE DEVOLUCIONES DE DINERO EN EFECTIVO.</strong> El medio de reembolso siempre será vía transferencia electrónica. <strong>El despacho del artículo o producto no es en ningún caso reembolsable</strong> y es considerado como coste del cliente.<br><br>Para hacer la devolución debes enviar el producto a nuestra dirección: Gral. Ordóñez 155 Of. 1002, comuna de Maipú o bien ir personalmente a realizar la devolución a dicho lugar. Infórmanos antes tu visita.<br><br>Para poder efectuar la devolución del dinero es importante que el artículo o producto no haya sido usado, que venga en su envase original sellado y en perfectas condiciones.<br>Zona Deportiva se reserva el derecho a rechazar el reembolso del artículo o producto comprado si el articulo\r\ndevuelto no cumple las condiciones indicadas en nuestra política de devolución.<br></p>', 9, 1, '2015-07-23 15:22:41', '2021-04-07 12:52:07', 'mbravo'),
(7, '¿Pueden vender en Mercado Público?', '<p>Zona Deportiva participa activamente en licitaciones de Mercado Público, estamos inscritos en el registro oficial de proveedores del Estado, Chileproveedores.<br></p>', 10, 1, '2015-07-23 15:37:29', '2017-06-28 12:48:32', 'mbravo'),
(8, '¿Puedo cotizar varios artículos para un colegio, empresa o institución?', '<p>Si eres representante de algún colegio, empresa o intitución y necesitas hacer una cotización por una cantidad importante de productos, para renovar tus implementos deportivos o adquirir nuevos artículos debes enviar un correo a: contacto@zonadeportiva.cl o al teléfono o Whatsaap&nbsp;+56 9 3936 9828  o al móvil&nbsp;+56 9 76584383. Nos comunicaremos a la brevedad para coordinar una visita o enviar el valor de lo que necesitas.</p><p>Para proceder a la cotización formal te solicitaremos algunos datos importantes como por ejemplo:<br></p><ul><li>Razón social.</li><li>R.U.T.</li><li>Dirección.<br></li><li>Nombre de Encargado o Contacto.</li><li>Teléfono para comunicarnos.<br><br></li></ul>', 8, 1, '2015-07-23 16:02:15', '2020-12-23 16:57:50', 'mbravo'),
(9, '¿Puedo pagar en efectivo cuando llegue el producto?', '<br>No, sólo se hacen despachos de productos cancelados vía Webpay Plus con Redcompra o tarjetas bancarias.&nbsp; <br><div style=\"clear:both\"></div>Para la región Metropolitana se hace el despacho mediante Una empresa externa, el costo de este envío se agrega al precio del artículo al momento de realizar la compra en nuestro sitio. Por lo que sólo debes esperar y recibir tu pedido en la dirección indicada.<br>Para compras desde regiones te contactaremos para coordinar la mejor forma de hacer el despacho y este siempre será por pagar a alguna oficina o sucursal de la alternativa de transporte que prefieras. Pero sólo cancelas la encomienda.  <div><br></div><div>En nuestra oficina los pagos aceptados son por tarjeta de débito o crédito y transferencia. <strong>Debido a la contingencia sanitaria</strong> <strong>NO ACEPTAMOS PAGOS EN EFECTVO.</strong></div>', 11, 1, '2015-07-24 17:38:35', '2020-12-23 17:01:46', 'mbravo'),
(10, '¿Hacen despachos a regiones?', '<br>Al momento de hacer tu compra debes informar si eres de Santiago o regiones. Para Santiago todos los envío se hacen vía empresas de transporte privadas (servicio externo)&nbsp;a la dirección indicada en el formulario. <br><br>Para regiones coordinamos con el comprador la alterativa que mejor le acomode para despacho o encomienda. Este despacho se hace a las oficinas o sucursales que el cliente informe y siempre en la modalidad por pagar.<br><br>Trabajamos enviando productos por distintas empresas, si no sabes o no conoces alguna que te acomode, nosotros la podemos recomendar. Para mayores detalles u otras consultas comunícate al correo: contacto@zonadeportiva.cl o al teléfono +56 9 3936 9828.', 12, 1, '2015-07-24 18:16:46', '2020-12-23 16:36:03', 'mbravo'),
(11, '¿Cuánto demora en llegar una compra?', '<p>Para todas las compras realizadas a través del sitio web y que hayan sido canceladas vía WEBPAY existe un tiempo de entrega a partir de&nbsp;<strong>2 (dos) días hábiles </strong>desde su transacción. Se entiende por <strong>DÍA HÁBIL</strong>, todos aquellos durante la semana de lunes a viernes, exceptuando aquellos que toquen ser feriados. Cómo ejemplo las compras  originadas un día jueves serán entregados desde&nbsp;el día lunes siguiente. <strong>El tiempo máximo de entrega estimado está en 7 días hábiles.</strong><br><br>Para compras realizadas con pago por transferencia se aplicará el mismo tiempo de despacho. Desde&nbsp;<strong>2 (dos) días hábiles en adelante</strong>, pero esta vez a partir de cuando se haya validado con comprobante y/o notificación de bancaria la correcta cancelación de los artículos.<br><br>El termino o modo de envío: <strong>DÍA HÁBIL SIGUIENTE</strong>, al que hace mención y referencia nuestro formulario de despacho y carro, es un <strong>concepto utilizado entre La empresa transportadora&nbsp;y Zona Deportiva SpA y NO&nbsp;OBEDECE&nbsp;NECESARIAMENTE A QUE UNA COMPRA REALIZADA EN NUESTRO SITIO LLEGUE&nbsp;24 horas después a su destino.</strong>&nbsp;</p><p><br>Para regiones o lugares más apartados de nuestro país, favor infórmese en detalle sobre alguna empresa que llegue a su destino,&nbsp;sus tiempos envío y/o entrega.</p><p>Podemos dar algunas alternativas de empresas que conozcamos para su localidad, empresas que son de bajo costo y de buen servicio, con las que ya hemos enviado en otras ocasiones.</p><p>Para más consultas comuníquese con nosotros al&nbsp;+56 9 3936 9828 vía teléfono o Whatsapp.</p>', 5, 1, '2016-05-10 23:28:23', '2020-12-23 16:46:51', 'mbravo'),
(12, '¿ Hacen ventas por mayor de artículos deportivos?', '<p>Lamentablemente no trabajamos con modalidad de venta por mayor en este momento.&nbsp;</p><p>Todas las ventas son precio&nbsp;detalle.</p>', 0, 1, '2017-06-28 12:46:43', '2020-12-23 16:52:11', 'mbravo');
