(21, 8, 0, 0, 7, '21', 'ARPIL35R', 'Aro de pilates de fibra', 'aro-de-pilates-de-fibra', NULL, '<p>Aro de pilates de fibra, 35cm de díametro. Es ideal para tonificar y reafirmar musculos abdominales, pecho, brazos y espaldas. Su diseño es ergonómico con agarres de goma suave. Color rojo.</p>', '', '', '', 'NORMAL', 0, 0, NULL, 0, '', 21, 0, '', '', '', '', '', '2015-07-23 14:14:54', '2020-07-24 14:13:58', 'admin'),
(22, 8, 0, 0, 1, '22', 'BP65CMAZ', 'Balón Pilates 65cms. Marca COVERTEC.', 'balon-pilates-65cms-marca-covertec', NULL, '<p>Balón Pilates Covertec, 65cm de diámetro. Sistema anti-burst. Incluye bombín.&nbsp;Es ideal para trabajar los pequeños músculos que de manera inconsciente nos permiten reequilibrarnos. Suele usarse para apoyar sobre él las piernas mientras se está recostado en el suelo o para apoyarse directamente sobre él  y ejercitar la flexibilidad de la columna vertebral.</p>', '', '', '', 'NORMAL', 0, 1, NULL, 0, '', 22, 1, '', '', '', '', '', '2015-07-23 14:14:54', '2020-08-30 23:30:40', 'mbravo'),
