(27, 8, 0, 0, 1, '27', 'BOCMACOV', 'Balón Bosu 60cm con manillas.', 'balon-bosu-60cm-con-manillas', NULL, '<p>Balón Bosu de 60cm de díametro con manillas desmontables, sistema anti-burst. Incluye Bombín.</p><p>El Bosu ayuda a fortalecer el cuerpo, mejorar la flexibilidad y la estabilidad de las articulaciones. Así como también sus ejercicios colaboran en la quema de calorías, refuerza ligamentos,  tonifica y mejora la flexibilidad y elasticidad. Contribuye a una más rápida recuperación de lesiones.</p>', '', '', '', 'NORMAL', 0, 1, NULL, 0, 'bosu,balon bosu,bozu,balón bosu,fitness bosu,articulos deportivos,kinesiologia,kinesiología,zona deportiva,zonadeportiva', 27, 1, '', '', '', '', '', '2015-07-23 14:14:54', '2020-11-25 18:17:09', 'mbravo'),
