(37, 8, 0, 0, 1, '37', 'PUUPBR', 'Barra Push Up PVC', 'barra-push-up-pvc', NULL, '<p>Las Barras Push Up reducen el estrés en las muñecas, permite aumentar el rango de movimiento, poseen sistema antideslizante y están fabricadas en PVC de alta resistencia, para óptima seguridad.</p>', '', '', '', 'NORMAL', 0, 0, NULL, 0, '', 37, 1, '', '', '', '', '', '2015-07-23 14:14:54', '2020-07-24 14:13:58', 'admin'),
(38, 8, 0, 0, 2, '38', 'RUABDOFL', 'Rueda Abdominal Doble Flott', 'rueda-abdominal-doble-flott', NULL, '<p>La rueda abdominal doble trabaja los músculos troncales en la parte inferior del torso, incluyendo el recto abdominal en el área del estómago, los flexores de la cadera y el dorsal ancho, que se extienden a través de la espalda desde la pelvis hasta el hombro. El ejercicio de rueda abdominal más básico, el despliegue, trabaja todos estos músculos. También puede utilizar la rueda abdominal para trabajar los brazos, los hombros y los muslos.</p>', '', '', '', 'NORMAL', 0, 0, NULL, 0, '', 38, 1, '', '', '', '', '', '2015-07-23 14:14:54', '2020-07-24 14:13:58', 'admin'),
(39, 8, 0, NULL, 2, '39', 'RUABSIFL', 'Rueda Abdominal Simple Flott', 'rueda-abdominal-simple-flott', NULL, '<p>La rueda abdominal simple trabaja los músculos troncales en la parte inferior del torso, incluyendo el recto abdominal en el área del estómago, los flexores de la cadera y el dorsal ancho, que se extienden a través de la espalda desde la pelvis hasta el hombro. El ejercicio de rueda abdominal más básico, el despliegue, trabaja todos estos músculos. También puede utilizar la rueda abdominal para trabajar los brazos, los hombros y los muslos.</p>', '', '', '', 'NORMAL', 0, 0, 1262, 0, '', 39, 1, '', '', '', '', '', '2015-07-23 14:14:54', '2020-07-24 14:13:58', 'admin'),
(40, 8, 0, 0, 1, '40', 'EXTUCVT_R', 'Tubo elástico EXPANDER TUBE COVERTEC Resitencia Media.', 'tubo-elastico-expander-tube-covertec-resitencia-media', NULL, '<p>Tubo elástico EXPANDER TUBE COVERTEC, resitencia media. 3mm de&nbsp;grosor.&nbsp;Color Rojo.</p><p>Permite&nbsp;trabajar todos los músculos, son excelentes para hacer elasticidad,&nbsp;fortalecer y tonifica&nbsp;brazos, pectorales y piernas.<br></p><p><br></p>', '', '', '', 'NORMAL', 0, 0, NULL, 0, '', 40, 1, '', '', '', '', '', '2015-07-23 14:14:55', '2020-07-24 14:13:58', 'admin'),
(41, 8, 0, 0, 1, '41', 'STAEREG', 'Step Aeróbico Regulable COVERTEC', 'step-aerobico-regulable-covertec', NULL, '<p>El step aeróbico permite un entrenamiento de tipo cardiovascular intenso que puede ayudarte a mejorar tu condición física y tu salud, así como a manejar tu peso. Su altura puede ser regulada. Mide 60x28x15cm</p>', '', '', '', 'NORMAL', 0, 1, NULL, 0, 'Step,COVERTEC,Zona Deportiva,Aerobica', 41, 1, '', '', '', '', '', '2015-07-23 14:14:55', '2020-07-24 14:13:58', 'admin'),
(43, 12, 0, 0, 1, '43', 'BAABREC', 'Banca abdominal recta COVERTEC', 'banca-abdominal-recta-covertec', NULL, '<p>Banca abdominal recta COVERTEC.</p><p>Medida: 97x30x40&nbsp;cm.</p><p><strong>Nota: \"Producto de gran volumen, puede contactarse vía correo al email contacto@zonadeportiva.cl o a nuestros teléfonos y acordaremos otros medios de despacho y/o de pago.\".  </strong>  </p>', '', '', '', 'NORMAL', 0, 1, NULL, 0, '', 42, 1, '', '', '', '', '', '2015-07-23 14:14:55', '2021-02-02 15:01:58', 'cdiaz'),
(44, 12, 0, 0, 1, '44', 'PRSBAC', 'Press Banca Covertec', 'press-banca-covertec', NULL, '<p>Press Banca Covertec.&nbsp;</p><p>- Imagen real.</p><p>-&nbsp;Peso máximo soportado para usuario100 kg.</p><p>-Peso máximo para discos 40kg.</p><p>-Tamaño armada:&nbsp;140 largo,110 alto, 60 ancho cms.  </p><p><br></p>', '', '<p>En Santiago el despacho tiene un valor adicional que aparece reflejado antes del pago final..</p><p>Para región enviamos por alguna empresa de transporte de\r\nbuen costo o nos puede solicitar la de su preferencia. El despacho se realiza\r\nPOR PAGAR.</p><p>Despachos entre 2 a 7 días hábiles.</p>  Tamaño embalaje:&nbsp;<strong>112x17x46cms y su peso es de10kg.</strong>', '', 'NORMAL', 0, 0, NULL, 0, '', 43, 1, '', '', '', '', '', '2015-07-23 14:14:55', '2021-02-03 17:50:08', 'mbravo'),
