(229, 10, 0, 0, 9, '226', 'PUBO4CSWF', 'Pull Buoy o Pullboy de Natación SWIMFIT', 'pull-buoy-o-pullboy-de-natacion-swimfit', '', 'El Pull Buoy (habitualmente mal escrito en español como “pull boy” o en \ninglés “pool buoy”) es un elemento de flotación con forma de ocho \ngeneralmente de espuma de celda cerrada. Seguro que has visto más de un \nentrenamiento con pull buoy&nbsp;tanto para adultos como para niños. Su \nfunción principal es la de &nbsp;dar flotación a las extremidades inferiores \npermitiendo la desaparición casi completa de la propulsión de piernas. Se utiliza para diferentes ejercicios.', '', '', '', 'NORMAL', 0, 1, NULL, 0, '', 220, 1, '', '', '', '', '', '2017-01-26 17:29:08', '2020-07-24 14:13:59', 'admin'),
(230, 10, 0, 0, 9, '227', 'TANATSWF', 'Tabla de Natación o Swim Kickboard SWIMFIT', 'tabla-de-natacion-o-swim-kickboard-swimfit', '', 'El uso de esta tabla es algo habitual en las clases de natación, ya que \nse trata de un cuerpo flotante que nos ayudará a mantener nuestra \npostura, pero no solo eso, sino que además será una buena manera de mejorar la técnica, ya que  nos ayuda a perfeccionar la realización de la brazada y de la patada, optimizando al máximo nuestro esfuerzos y obteniendo los mejores resultados al respecto.', '', '', '', 'NORMAL', 0, 0, 1380, 1, '', 221, 1, '', '', '', '', '', '2017-01-26 18:57:50', '2020-07-24 14:13:59', 'admin'),
