(295, 22, 0, 0, 1, '356', 'TRT-2HP-CVT', 'Trotadora eléctrica COVERTEC Motor 2.0 HP', 'trotadora-electrica-covertec-motor-20-hp', '', 'Trotadora eléctrica marca&nbsp;COVERTEC.&nbsp;Black Series / Modelo&nbsp;CVT-BS2.0<div><br></div><div>-&nbsp;Motor 2.0 HP. </div><div>- Pantalla con indicador de frecuencia&nbsp;cardíaca, velocidad, distancia, tiempo y calorías.</div><div>- 12 progamas y 3 modos de entrenamiento.</div><div>- Incluye medidor de pulso de contacto.</div><div>- Dispositivo magnético de seguridad.</div><div>- Rango de velocidad entre 1 y 12,8 km/h.</div><div>- Superficie de carrera: 100x40 cms.</div><div>- Peso Máximo&nbsp;usuario: 100&nbsp;Kgs.</div><div>- Posibilidad de plegado.</div><div><br></div><div><div><strong></strong></div><div><strong></strong></div><div><div><strong style=\"background-color:#ffff33\"><strong>IMPORTANTE: Por defecto el sistema dice ENTREGA DÍA HÁBIL SIGUIENTE.&nbsp;Esta condición no se aplica para este producto.</strong></strong></div></div><div><strong style=\"background-color:#ffff33\"><strong><br></strong></strong></div><div><strong style=\"background-color:#ffff33\"><strong>El servicio de armado de trotadora sólo para es para Región Metropolitana.</strong></strong></div><div><strong><br></strong></div><div><strong>CONSULTAS&nbsp;a nuestro Whatsapp + 56 9&nbsp;3936 9828.</strong></div>  <div><strong></strong></div>  <div><strong></strong></div>  <br></div><div><br></div><div><br></div><div><br></div><div><br></div>', '', '<div><strong style=\"background-color:#ffff33\">IMPORTANTE: Por defecto el sistema dice ENTREGA DÍA HÁBIL SIGUIENTE.&nbsp;Esta condición no se aplica para este producto.&nbsp;</strong><br></div><div><br></div>Los despachos en Santiago serán&nbsp;coordinados&nbsp;previamente con nuestros clientes. Este servicio&nbsp;tiene&nbsp;un valor adicional, que aparece reflejado el carro de compra antes de hacer el pago final.<div><br></div><div><strong style=\"background-color:#ffff33\"></strong></div><div><strong><br></strong></div><div>Para región el despacho se realiza <strong>POR PAGAR </strong>en la empresa de transporte que prefiera el cliente.&nbsp;También podemos sugerir alguna de buen servicio y costo que sea distinta a Chilexpress y Starken.<strong></strong></div><div><strong><br></strong></div><div>Las especificaciones del embalaje son las siguientes: <strong>143x75x31 cms y el peso es de 37.5 kg.</strong></div>', '<h3 style=\"\" margin:0cm;margin-bottom:.0001pt;line-height:16.8pt;vertical-align:baseline\"\"=\"\">¡IMPORTANTE!</h3>\r\n<p style=\"\" margin:0cm;margin-bottom:.0001pt;line-height:16.8pt;vertical-align:baseline\"\"=\"\">Antes de\r\nutilizar la trotadora, es imperante leer cuidadosamente el manual del usuario\r\nya que si no es armada, lubricada y ajustada de manera correcta se podrían\r\nprovocar daños graves en la maquina lo que implica la perdida de la garantía.</p>\r\n<p style=\"\" margin:0cm;margin-bottom:.0001pt;line-height:16.8pt;vertical-align:baseline\"\"=\"\">Las\r\ntrotadoras para uso doméstico (hogar) necesitan un mantenimiento&nbsp;periódico&nbsp;por\r\nparte y cuenta del usuario, específicamente en lo que respecta a la lubricación\r\ny el ajuste de la cinta.</p>\r\n<p style=\"\" margin:0cm;margin-bottom:.0001pt;line-height:16.8pt;vertical-align:baseline\"\"=\"\">Para un\r\nrendimiento óptimo de la máquina y evitar un desgaste prematuro de las partes,\r\nse recomienda realizar este&nbsp;mantenimiento&nbsp;cada 15 días si es necesario.</p>\r\n<p style=\"\" margin:0cm;margin-bottom:.0001pt;line-height:16.8pt;vertical-align:baseline\"\"=\"\">Las\r\ntrotadoras para uso doméstico NO están diseñadas para trabajar por periodos\r\nextensos de exigencia y sobrecarga como en un gimnasio ya que podrían provocar\r\nsobrecalentamiento y daños graves en el motor y sus partes móviles.</p>\r\n<p style=\"\" margin:0cm;margin-bottom:.0001pt;line-height:16.8pt;vertical-align:baseline\"\"=\"\">Para\r\nprolongar la vida útil de la máquina, en el caso de los modelos con motor de 2.0&nbsp;HP se recomienda utilizar solo por periodos de un máximo de 50&nbsp;minutos para\r\nposteriormente dejar enfriar durante al menos 25 minutos antes de volver a\r\nutilizar.</p>\r\n<p style=\"\" margin:0cm;margin-bottom:.0001pt;line-height:16.8pt;vertical-align:baseline\"\"=\"\">Respecto\r\nal peso máximo del usuario: El fabricante indica como peso límite de\r\nusuario 100&nbsp;kg, de este modo, se sugiere no sobrepasar los 100&nbsp;kg del usuario para así&nbsp;extender la vida útil de la máquina.</p>', 'NORMAL', 0, 1, 9358, 1, '', 284, 1, '', '', '', '', '', '2020-07-29 02:38:05', '2021-01-25 15:22:47', 'cdiaz'),
