baseline\"\"=\"\">Para prolongar la vida útil de la máquina, en el caso de los modelos con motor de 1.5&nbsp;HP se recomienda utilizar solo por periodos de un máximo de 30&nbsp;minutos para posteriormente dejar enfriar durante al menos 25 minutos antes de volver a utilizar.</p><p margin:0cm;margin-bottom:.0001pt;line-height:16.8pt;vertical-align:baseline\"\"=\"\">Respecto al peso máximo del usuario: El fabricante indica como peso límite de usuario 90 kg, de esta manera, se sugiere no sobrepasar los 90&nbsp;kg del usuario, para así&nbsp;extender la vida útil de la máquina.</p>  <div><strong><p style=\"\" margin:0cm;margin-bottom:.0001pt;line-height:16.8pt;vertical-align:baseline\"\"=\"\"><br></p></strong></div>', 'NORMAL', 0, 0, 7767, 1, '', 287, 1, '', '', '', '', '', '2020-08-05 00:02:31', '2020-12-07 13:41:36', 'mbravo'),
