(315, 22, 0, 0, 1, '374', 'HMGYM45K-COVERTEC', 'HOME GYM 45K COVERTEC', 'home-gym-45k-covertec', '', '<div><article><section><section hook=\"description-wrapper\"><p>Home Gym HG-45k<br><br></p><p>Estructura metálica de alta resistencia con respaldos ergonómicos en extremidades, espalda y piernas.<br>Carga de peso distribuida en 15 ladrillos.<br><br>Permite trabajo inferior, medio y superior del cuerpo:&nbsp;Gemelos, muslos, abductores, abdomen, pectorales, hombros, dorso, bíceps, tríceps, trapecios, deltoides.</p><p>Permite carga de trabajo para series / repeticiones de niveles bajos, medios y altos.</p><p>Medidas cuando está ARMADA:&nbsp;205 cms. de alto&nbsp; x&nbsp;140 cms. de largo&nbsp;x 100&nbsp;cms. de&nbsp;ancho.</p>  <br></section></section><section><div><div hook=\"product-prices-wrapper\"><div hook=\"product-price\"><div></div></div></div></div><div><div hook=\"product-payment-breakdown\"><div hook=\"payment-methods-banner\"></div></div></div><div><div hook=\"product-options\"><div hook=\"product-options-inputs\"></div></div><div></div></div><div><div dir=\"ltr\"><ul hook=\"collapse-info-section\"></ul></div></div></section><br><div><div hook=\"bottom-placeholder\"></div></div></article><br></div><div disabled=\"disabled\"><a testid=\"linkElement\" href=\"https://www.webpay.cl/portalpagodirecto/pages/institucion.jsf?idEstablecimiento=65485495\" target=\"_blank\" rel=\"noopener\"></a></div>', '', 'Los despachos en Santiago serán&nbsp;coordinados&nbsp;previamente con nuestros clientes. Este servicio&nbsp;tiene&nbsp;un valor adicional&nbsp;que aparece reflejado en&nbsp;el carro de compra antes de hacer el pago final.<div><br></div><strong></strong><div><strong>Para región el despacho se realiza&nbsp;<strong>POR PAGAR&nbsp;</strong>en la empresa de transporte que prefiera el cliente.&nbsp;También podemos sugerir alguna de buen servicio y costo que sea distinta a Chilexpress y Starken.</strong></div><div><strong><br></strong></div><div><strong>Las especificaciones del embalaje son las siguientes:</strong></div><div><strong><br></strong></div><div><strong>3&nbsp;Bultos:</strong></div><div><strong><br></strong></div><div><strong>1.-</strong><strong>&nbsp;38x19x22cm. 22.9 KG</strong></div><div><strong>2.- 38x19x27 cm. 22.5KG</strong></div><div><strong>3.-184x46x19cm. 40KG</strong></div><div><strong><br></strong></div><div><strong>EL ARMADO DE LA HOME GYM SE REALIZA SOLO DENTRO DE SANTIAGO CON COSTO ADICIONAL DE $25.000.&nbsp;</strong></div>', '', 'NORMAL', 0, 0, 954, 1, '', 302, 1, '', '', '', '', '', '2021-02-25 11:17:01', '2021-03-25 17:25:45', 'mbravo'),
(316, 22, 0, 0, 1, '375', 'HMGYM65K-CVT', 'HOME GYM 65K COVERTEC', 'home-gym-65k-covertec', '', '<p>Home Gym HG-65k<br><br></p><p>Estructura metálica de alta resistencia con respaldos ergonómicos en extremidades, espalda y piernas.<br>Carga de peso distribuida en 15 ladrillos.<br><br>Permite trabajo inferior, medio y superior del cuerpo:&nbsp;Gemelos, muslos, abductores, abdomen, pectorales, hombros, dorso, bíceps, tríceps, trapecios, deltoides.</p><p>Permite carga de trabajo para series / repeticiones de niveles bajos, medios y altos.  </p><p>Medidas cuando está ARMADA:&nbsp;205 cms. de alto&nbsp; x&nbsp;140 cms. de largo&nbsp;x 105 cms. de&nbsp;ancho.  <br></p>', '', 'Los despachos en Santiago serán&nbsp;coordinados&nbsp;previamente con nuestros clientes. Este servicio&nbsp;tiene&nbsp;un valor adicional&nbsp;que aparece reflejado en&nbsp;el carro de compra antes de hacer el pago final.<div><br></div><strong></strong><div><strong>Para región el despacho se realiza&nbsp;<strong>POR PAGAR&nbsp;</strong>en la empresa de transporte que prefiera el cliente.&nbsp;También podemos sugerir alguna de buen servicio y costo que sea distinta a Chilexpress y Starken.</strong></div><div><strong><br></strong></div><div><strong>Las especificaciones del embalaje son las siguientes:</strong></div><div><strong><br></strong></div><div><strong>3&nbsp;Bultos:</strong></div>  <div><div><strong><strong>  <br></strong></strong></div></div><div><strong><strong>1.-38x18.5x38.5cm.36KG</strong></strong></div><div><strong><strong>2.-38x19x31cm.32KG</strong></strong></div><div><strong><strong>3.-184x46x19cm.40KG</strong></strong></div><div><strong><strong><strong><br></strong></strong></strong></div><div><strong><strong><strong>EL ARMADO DE LA HOME GYM&nbsp;SE REALIZA SOLO DENTRO DE SANTIAGO CON&nbsp;COSTO ADICIONAL DE $25.000.&nbsp;</strong>  <br></strong></strong></div>', '', 'NORMAL', 0, 0, 1470, 1, '', 303, 1, '', '', '', '', '', '2021-02-25 11:23:42', '2021-03-25 17:21:41', 'mbravo'),
(317, 22, 0, 0, 1, '376', 'BC-SPN-PG15K', 'Bicicleta de SPINNING COVERTEC PROGRESS 15K', 'bicicleta-de-spinning-covertec-progress-15k', '', '<div>Bicicleta de SPINNING marca COVERTEC, modelo PROGRESS 15K.</div><div><br></div><div>Es una bicicleta de SPINNING equipada con un volante bidireccional pesado, que&nbsp;ofrece&nbsp;más impulso para brindarle una experiencia de ejercicio desafiante. Varios niveles de tensión te permiten crear diferentes entrenamientos intensos y quemar más calorías.&nbsp;Posee pantalla LCD y pulso manual.&nbsp;El monitor digital rastreará y registrará en tiempo real tu tiempo de ejercicio, velocidad, distancia, calorías y pulso, para que puedas conocer tu&nbsp;progreso y ajustar tu plan de ejercicios.&nbsp;Mango de pulso de mano con monitor de ejercicio pre-montado.</div><div>Segura, cómoda&nbsp;y fácil de mover. Soporta hasta 150kgs, los pedales antideslizantes de la bicicleta de ciclismo están diseñados con jaulas de dedos ajustables.&nbsp;</div><div><br></div><div>- Resistencia ilimitada ajustable.</div><div>- Volante recubierto con EVA.</div><div>- Rueda inercial de 15kgs.</div><div>- Volante y asiento ajustable.</div><div>- Apoya brazos de poliuretano.</div><div>- Freno doble con sistema de&nbsp;detención   rápida&nbsp;para&nbsp;de&nbsp;emergencia.</div><div>- Pedales&nbsp;metálicos con contratuerca.</div><div>- Peso máximo usuario 150 kilos.</div><div>- Funciones de computador: Escaneo, tiempo, velocidad, distancia, caloría, pulso.</div><div>- Diseño robusto.</div><div>- Sillín acolchado anti-prostático</div><div>- Volumen armado: Ancho 43 cm x Largo 110 cm&nbsp; x Alto 115 cms.&nbsp; x Alto 115 cms.</div><div><br></div><div><strong>CONSULTAS&nbsp;a nuestro Whatsapp + 56 9&nbsp;3936 9828.</strong>  <br></div><div><strong><br></strong></div><div><strong><strong style=\"color:#000000;background-color:#ffff00\">DESPACHO SE REALIZA&nbsp;entre 2 a 7 días hábiles en SANTIAGO.</strong>  <br></strong></div><div><strong><br></strong></div><div><strong><br></strong></div>', '', '', '', 'NORMAL', 0, 1, 129, 1, 'Spinning,spinin,spinnin,bicicleta,estatica,covertec', 304, 1, '', '', '', '', '', '2021-07-06 17:42:45', NULL, 'mbravo'),
